const API_KEY = "75b1242fafea7d5177dca77f56a9e008";

const requests = {
  fetchTrending: `/trending/all/week?api-key=${API_KEY}&language=en-US`,
  fetchNetflixOriginals: `/discover/tv?api-key=${API_KEY}&with-networks=213`,
};

export default requests;
